import Sidebar from './Sidebar'

const SidebarContainer = (props) => {
    return (
        <StoreContext.Consumer>
            {
                (store) => {
                    let state = store.getState();
                    return < Sidebar friends= {state.sidebar.friends}/>
                }
            }
        </StoreContext.Consumer>
    );
}
